import { combineReducers } from '@reduxjs/toolkit'

import {appSlice} from './appSlice';
import { resultListSlice } from './resultListSlice';

const rootReducer = combineReducers({
    app : appSlice,
    result : resultListSlice
})


export default rootReducer
